import React from 'react';
import CorreoForm from './components/formularioCorreo';

const App = () => {
  return (
    <div>
      <CorreoForm />
      <h1>Formulario de Correo</h1>
      
      <a
          href="./components/form2.html"
        >
          Learn React
        </a>
        
    </div>
  );
};

export default App;
